import './Navbar.css';
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import logo from './images/health-icon.png'; 

export default function Navbar({ role }) {
    const [isOpen, setIsOpen] = useState(false);

    const toggleNav = () => {
        setIsOpen(!isOpen); 
    };

    const closeNav = () => {
        setIsOpen(false);
    };

    return (
        <>
            <div className="hamburger" onClick={toggleNav}>
                <span></span>
                <span></span>
                <span></span>
            </div>

            <nav className={`nav ${isOpen ? 'open' : ''}`}>
                <div className='header'>
                    <img src={logo} className="logo" alt="Logo" />
                    <div className="site-title">Health Portal</div>
                </div>
                <ul>
                    <li>
                        <Link to='/Messages' onClick={closeNav}>Messages</Link>
                    </li>
                    <li>
                        <Link to='/Appointments' onClick={closeNav}>Appointments</Link>
                    </li>
                    {/* Render this link only if the role is 'doctor' */}
                    {role === 'doctor' &&
                        <li>
                            <Link to='/HealthRecords' onClick={closeNav}>Health Records</Link>
                        </li>
                    }
                    {/* Render this link only if the role is 'patient' */}
                    {role === 'patient' &&
                        <li>
                            <Link to='/PatientDashboard' onClick={closeNav}>Patient Dashboard</Link>
                        </li>
                    }
                </ul>
            </nav>
        </>
    );
}
